// Code by Simon LUCAS - 27/06/2022

// Submission to the Shadertoy HPG 2022 student competition

// Common   :
//    - shader configuration
//    - implementation of "BRDF Importance Sampling for Polygonal Lights, SIGGRAPH 2021" from Christoph Peters
// Buffer A : 
//    - linearly transformed cosines GGX LUT, from "Real-Time Polygonal-Light Shading with Linearly Transformed Cosines, Eric Heitz, Jonathan Dupuy, Stephen Hill and David Neubelt, SIGGRAPH 2016"
// Buffer B :
//    - pathtracing
//    - reprojection
// Buffer C : 
//    - tonemapping
//    - gamma correction
// Buffer D :
//    - screen space temporal anti-aliasing

// This shader was developed using windows, firefox (force opengl) and nvidia GPU

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord / iResolution.xy;

    fragColor = texture(iChannel3, uv);

    #ifdef DIFF
    if(uv.x > 0.5)
        fragColor = texture(iChannel2, uv);
    #endif
}

