}

// adapted from https://cwyman.org/code/dxrTutors/tutors/Tutor14/tutorial14.md.html
float
ggxNormalDistribution(float NdotH, float roughness_sqr)
{
	float d = ((NdotH * roughness_sqr - NdotH) * NdotH + 1.0);
	return roughness_sqr / (d * d * PI);
}

float
schlickMaskingTerm(float NdotL, float NdotV, float roughness_sqr)
{
	// Karis notes they use alpha / 2 (or roughness^2 / 2)
	float k = roughness_sqr / 2.0;

	// Compute G(v) and G(l).  These equations directly from Schlick 1994
	//     (Though note, Schlick's notation is cryptic and confusing.)
	float g_v = NdotV / (NdotV*(1.0 - k) + k);
	float g_l = NdotL / (NdotL*(1.0 - k) + k);
	return g_v * g_l;
}

vec3
schlickFresnel(vec3 f0, float lDotH)
{
	return f0 + (vec3(1.0, 1.0, 1.0) - f0) * pow(1.0 - lDotH, 5.0);
}

// When using this function to sample, the probability density is:
//      pdf = D * NdotH / (4 * HdotV)
vec3
getGGXMicrofacetTS(vec2 randVal, float roughness_sqr, vec3 hitNorm)
{
	// GGX NDF sampling
	float cosThetaH = sqrt(max(0.0, (1.0 - randVal.x) / ((roughness_sqr - 1.0) * randVal.x + 1.0)));
	float sinThetaH = sqrt(max(0.0, 1.0 - cosThetaH * cosThetaH));
	float phiH = randVal.y * PI * 2.0;

	// Get our GGX NDF sample (i.e., the half vector)
	return vec3(sinThetaH * cos(phiH), cosThetaH, sinThetaH * sin(phiH));
}

