{
	mat4 ret = mat4(1.0);
	ret[0][0] = ret[2][2] = cos(a);
	ret[0][2] = sin(a);
	ret[2][0] = -ret[0][2];
	return ret;
}


void findSilhouette(vec3 p, int cube, in mat4x3 onb_ltc, out vec3 silhouette[MAX_POLYGON_VERTEX_COUNT], out uint vertex_num) {
    vec3 cube_pos = cube_light_pos[cube].xyz;
	float cube_rot = cube_light_pos[cube].w;

    vec3 q = p - cube_pos;
    q.xz *= ROT(cube_rot);

    vec3 s = sign(q);
    q = abs(q);


    float r = cube_light_size*0.5;

    bool x_side = q.x > r; 
    bool y_side = q.y > r;
    bool z_side = q.z > r;

    bool clockwise  =  (x_side && s.x < 0.) 
                    ^^ (y_side && s.y < 0.)
                    ^^ (z_side && s.z < 0.);

    uint case_id = (uint(clockwise) << 3)
                 | (uint(x_side) << 2)
                 | (uint(y_side) << 1)
                 | (uint(z_side));

    switch(case_id)
    {
    case 15u:
        silhouette[0] = vec3( 1, 1,-1);
        silhouette[1] = vec3(-1, 1,-1);
        silhouette[2] = vec3(-1, 1, 1);
        silhouette[3] = vec3(-1,-1, 1);
        silhouette[4] = vec3( 1,-1, 1);
        silhouette[5] = vec3( 1,-1,-1);
        vertex_num = 6u;
        break;
    case 7u:
        silhouette[0] = vec3( 1,-1,-1);
        silhouette[1] = vec3( 1,-1, 1);
        silhouette[2] = vec3(-1,-1, 1);
        silhouette[3] = vec3(-1, 1, 1);
        silhouette[4] = vec3(-1, 1,-1);
        silhouette[5] = vec3( 1, 1,-1);
        vertex_num = 6u;
        break;
   case 14u:
        s.z = 1.;
        silhouette[0] = vec3( 1, 1,-1);
        silhouette[1] = vec3(-1, 1,-1);
        silhouette[2] = vec3(-1, 1, 1);
        silhouette[3] = vec3( 1, 1, 1);
        silhouette[4] = vec3( 1,-1, 1);
        silhouette[5] = vec3( 1,-1,-1);
        vertex_num = 6u;
        break; 
    case 6u:
        s.z = 1.;
        silhouette[0] = vec3( 1,-1,-1);
        silhouette[1] = vec3( 1,-1, 1);
        silhouette[2] = vec3( 1, 1, 1);
        silhouette[3] = vec3(-1, 1, 1);
        silhouette[4] = vec3(-1, 1,-1);
        silhouette[5] = vec3( 1, 1,-1);
        vertex_num = 6u;
        break;
    case 13u:
        s.y = 1.;
        silhouette[0] = vec3( 1, 1,-1);
        silhouette[1] = vec3( 1, 1, 1);
        silhouette[2] = vec3(-1, 1, 1);
        silhouette[3] = vec3(-1,-1, 1);
        silhouette[4] = vec3( 1,-1, 1);
        silhouette[5] = vec3( 1,-1,-1);
        vertex_num = 6u;
        break;
    case 5u:
        s.y = 1.;
        silhouette[0] = vec3( 1,-1,-1);
        silhouette[1] = vec3( 1,-1, 1);
        silhouette[2] = vec3(-1,-1, 1);
        silhouette[3] = vec3(-1, 1, 1);
        silhouette[4] = vec3( 1, 1, 1);
        silhouette[5] = vec3( 1, 1,-1);
        vertex_num = 6u;
        break;
    case 11u:
        s.x = 1.;
        silhouette[0] = vec3( 1, 1,-1);
        silhouette[1] = vec3(-1, 1,-1);
        silhouette[2] = vec3(-1, 1, 1);
        silhouette[3] = vec3(-1,-1, 1);
        silhouette[4] = vec3( 1,-1, 1);
        silhouette[5] = vec3( 1, 1, 1);
        vertex_num = 6u;
        break;    
    case 3u:
        s.x = 1.;
        silhouette[0] = vec3( 1, 1, 1);
        silhouette[1] = vec3( 1,-1, 1);
        silhouette[2] = vec3(-1,-1, 1);
        silhouette[3] = vec3(-1, 1, 1);
        silhouette[4] = vec3(-1, 1,-1);
        silhouette[5] = vec3( 1, 1,-1);
        vertex_num = 6u;
        break;
    case 12u:
        s.y = 1.;
        s.z = 1.;
        silhouette[0] = vec3( 1,-1, 1);
        silhouette[1] = vec3( 1,-1,-1);
        silhouette[2] = vec3( 1, 1,-1);
        silhouette[3] = vec3( 1, 1, 1);
        vertex_num = 4u;
        break;
    case 4u:
        s.y = 1.;
        s.z = 1.;
        silhouette[0] = vec3( 1, 1, 1);
        silhouette[1] = vec3( 1, 1,-1);
        silhouette[2] = vec3( 1,-1,-1);
        silhouette[3] = vec3( 1,-1, 1);
        vertex_num = 4u;
        break;
    case 10u:
        s.x = 1.;
        s.z = 1.;
        silhouette[0] = vec3( 1, 1,-1);
        silhouette[1] = vec3(-1, 1,-1);
        silhouette[2] = vec3(-1, 1, 1);
        silhouette[3] = vec3( 1, 1, 1);
        vertex_num = 4u;
        break;
    case 2u:
        s.x = 1.;
        s.z = 1.;
        silhouette[0] = vec3( 1, 1, 1);
        silhouette[1] = vec3(-1, 1, 1);
        silhouette[2] = vec3(-1, 1,-1);
        silhouette[3] = vec3( 1, 1,-1);
        vertex_num = 4u;
        break;
    case 9u:
        s.x = 1.;
        s.y = 1.;
        silhouette[0] = vec3(-1, 1, 1);
        silhouette[1] = vec3(-1,-1, 1);
        silhouette[2] = vec3( 1,-1, 1);
        silhouette[3] = vec3( 1, 1, 1);
        vertex_num = 4u;
        break;
    case 1u:
        s.x = 1.;
        s.y = 1.;
        silhouette[0] = vec3( 1, 1, 1);
        silhouette[1] = vec3( 1,-1, 1);
        silhouette[2] = vec3(-1,-1, 1);
        silhouette[3] = vec3(-1, 1, 1);
        vertex_num = 4u;
        break;

    }

    vec3 sr = s*r;

    silhouette[0] *= sr;
    silhouette[1] *= sr;
    silhouette[2] *= sr;
    silhouette[3] *= sr;
    silhouette[4] *= sr;
    silhouette[5] *= sr;

    mat2 rot = ROT(-cube_rot);
    silhouette[0].xz *= rot;
    silhouette[1].xz *= rot;
    silhouette[2].xz *= rot;
    silhouette[3].xz *= rot;
    silhouette[4].xz *= rot;
    silhouette[5].xz *= rot;

    silhouette[0] += cube_pos;
    silhouette[1] += cube_pos;
    silhouette[2] += cube_pos;
    silhouette[3] += cube_pos;
    silhouette[4] += cube_pos;
    silhouette[5] += cube_pos;

    silhouette[0] = normalize(onb_ltc * vec4(silhouette[0],1.));
    silhouette[1] = normalize(onb_ltc * vec4(silhouette[1],1.));
    silhouette[2] = normalize(onb_ltc * vec4(silhouette[2],1.));
    silhouette[3] = normalize(onb_ltc * vec4(silhouette[3],1.));
    silhouette[4] = normalize(onb_ltc * vec4(silhouette[4],1.));
    silhouette[5] = normalize(onb_ltc * vec4(silhouette[5],1.));

    silhouette[vertex_num] = silhouette[0]; // Repeat first vertex

}

float evaluate_ltc_density(mat3 shading_to_cosine, float shading_to_cosine_space_determinant , vec3 dir_shading_space) {
	vec3 dir_cosine_space = shading_to_cosine * dir_shading_space;
	float cosine_space_length_squared = dot(dir_cosine_space, dir_cosine_space);
	float ltc_density = max(0.0f, dir_cosine_space.z) * shading_to_cosine_space_determinant / (cosine_space_length_squared * cosine_space_length_squared);
	return ltc_density;
}


bool
intersect_aabb(in Ray ray, in AABB aabb, inout float t_min, inout float t_max)
{
	vec3 div = 1.0 / ray.dir;
	vec3 t_1 = (aabb.min_ - ray.origin) * div;
	vec3 t_2 = (aabb.max_ - ray.origin) * div;

	vec3 t_min2 = min(t_1, t_2);
	vec3 t_max2 = max(t_1, t_2);

	t_min = max(max(t_min2.x, t_min2.y), max(t_min2.z, t_min));
	t_max = min(min(t_max2.x, t_max2.y), min(t_max2.z, t_max));

	return t_min < t_max;
}

vec3
ray_at(in Ray ray, float t)
{
	return ray.origin + t * ray.dir;
}

float
intersect_plane(
	Ray ray,
    vec3 center,
    vec3 normal)
{
    float denom = dot(ray.dir, normal);
    float t = dot(center - ray.origin, normal) / denom;
	return t > 0.0 ? t : INFINITY;
}

float
intersect_box(Ray ray, out vec3 normal, vec3 position_min, vec3 position_max)
{
	float t_min = 0.0;
	float t_max = 999999999.0;
	if(intersect_aabb(ray, AABB(position_min, position_max), t_min, t_max)) {
		vec3 p = ray_at(ray, t_min);

		vec3 center = (position_min + position_max) * 0.5;

		normal = p - center;

		vec3 an = abs(normal) / (position_max - position_min);

		if(an.x > an.y && an.x > an.z) {
			normal = vec3(normal.x > 0.0 ? 1.0 : -1.0, 0, 0);
		}
		else if(an.y > an.x && an.y > an.z) {
			normal = vec3(0, normal.y > 0.0 ? 1.0 : -1.0, 0);
		}
		else {
			normal = vec3(0, 0, normal.z > 0.0 ? 1.0 : -1.0);
		}

		return t_min;
	}

	return INFINITY;
}

float
intersect(Ray ray, inout vec3 p, inout vec3 normal, out MaterialSample ms, out int obj_index)
{
	float t_min = INFINITY;
    obj_index = -1;
	int material = -1;

    vec3 normal_tmp;
    Ray ray_tmp = ray;
    const vec3 bbox_C_origin = vec3(-1.);
    const vec3 bbox_C_size = vec3(2.);
    float bbox_tmin = 0.;
    float bbox_tmax = 9999999.;
    if(!intersect_aabb(ray_tmp, AABB(bbox_C_origin, bbox_C_origin+bbox_C_size), bbox_tmin, bbox_tmax)){
        return INFINITY;
    }

    // H
    ray_tmp = ray;
    mat4 r = rotate_y(-0.35);
    ray_tmp.origin -= vec3(-0.9, -1, 0.0);
    ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
    ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
    const vec3 bbox_H_origin = vec3(bbox_H.xy, 0.0);
    const vec3 bbox_H_size = vec3(bbox_H.zw - bbox_H.xy, 0.15);
    bbox_tmin = 0.;
    bbox_tmax = 9999999.;
    if(intersect_aabb(ray_tmp, AABB(bbox_H_origin, bbox_H_origin+bbox_H_size), bbox_tmin, bbox_tmax)){
        for(int i = 0; i < coordinates_H.length(); i++) {

            vec3 box_origin = vec3(coordinates_H[i].xy, 0.0);
            vec3 box_size = vec3(coordinates_H[i].zw - coordinates_H[i].xy, 0.15);
            float t = intersect_box(ray_tmp, normal_tmp, box_origin, box_origin + box_size);
            if(t < t_min) {
                t_min = t;
                p = ray_at(ray, t);
                material = MAT_H;
                normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            }
        }
    }

    // P
    ray_tmp = ray;
    r = rotate_y(0.75);
    ray_tmp.origin -= vec3(-0.28, -1, 0.2);
    ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
    ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
    const vec3 bbox_P_origin = vec3(bbox_P.xy, 0.0);
    const vec3 bbox_P_size = vec3(bbox_P.zw - bbox_P.xy, 0.15);
    bbox_tmin = 0.;
    bbox_tmax = 9999999.;
    if(intersect_aabb(ray_tmp, AABB(bbox_P_origin, bbox_P_origin+bbox_P_size), bbox_tmin, bbox_tmax)){
        for(int i = 0; i < coordinates_P.length(); i++) {


            vec3 box_origin = vec3(coordinates_P[i].xy, 0.0);
            vec3 box_size = vec3(coordinates_P[i].zw - coordinates_P[i].xy, 0.15);
            float t = intersect_box(ray_tmp, normal_tmp, box_origin, box_origin + box_size);
            if(t < t_min) {
                t_min = t;
                p = ray_at(ray, t);
                material = MAT_P;
                normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            }
        }
    }

    // G
    ray_tmp = ray;
    r = rotate_y(-0.4);
    ray_tmp.origin -= vec3(0.35, -1, -0.20);
    ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
    ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
    const vec3 bbox_G_origin = vec3(bbox_G.xy, 0.0);
    const vec3 bbox_G_size = vec3(bbox_G.zw - bbox_G.xy, 0.15);
    bbox_tmin = 0.;
    bbox_tmax = 9999999.;
    if(intersect_aabb(ray_tmp, AABB(bbox_G_origin, bbox_G_origin+bbox_G_size), bbox_tmin, bbox_tmax)){
        for(int i = 0; i < coordinates_G.length(); i++) {

            vec3 box_origin = vec3(coordinates_G[i].xy, 0.0);
            vec3 box_size = vec3(coordinates_G[i].zw - coordinates_G[i].xy, 0.15);
            float t = intersect_box(ray_tmp, normal_tmp, box_origin, box_origin + box_size);
            if(t < t_min) {
                t_min = t;
                p = ray_at(ray, t);
                material = MAT_G;
                normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            }
        }
	} 

#ifdef FULL_SCENE
    // 2
    ray_tmp = ray;
    r = rotate_y(0.0);
    ray_tmp.origin -= vec3(0.1, -0.2, -1.0);
    ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
    ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
    const vec3 bbox_2_origin = vec3(bbox_2.xy, 0.0);
    const vec3 bbox_2_size = vec3(bbox_2.zw - bbox_2.xy, 0.15);
    bbox_tmin = 0.;
    bbox_tmax = 9999999.;
    if(intersect_aabb(ray_tmp, AABB(bbox_2_origin, bbox_2_origin+bbox_2_size), bbox_tmin, bbox_tmax)){
        for(int i = 0; i < coordinates_2.length(); i++) {
            vec3 box_origin = vec3(coordinates_2[i].xy, 0.0);
            vec3 box_size = vec3(coordinates_2[i].zw - coordinates_2[i].xy, 0.125);
            float t = intersect_box(ray_tmp, normal_tmp, box_origin, box_origin + box_size);
            if(t < t_min) {
                t_min = t;
                p = ray_at(ray, t);
                material = MAT_2;
                normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            }
        }
    }
    // 2
    ray_tmp = ray;
    ray_tmp.origin -= vec3(0.45, -0.2, -1.0);
    ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
    ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
    bbox_tmin = 0.;
    bbox_tmax = 9999999.;
    if(intersect_aabb(ray_tmp, AABB(bbox_2_origin, bbox_2_origin+bbox_2_size), bbox_tmin, bbox_tmax)){
        for(int i = 0; i < coordinates_2.length(); i++) {
