            if(t < t_min) {
                t_min = t;
                p = ray_at(ray, t);
                material = MAT_2;
                normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            }
        }
    }
#endif


	// cube light sources
	for(int i = 0; i < cube_light_pos.length(); i++) {
		vec3 normal_tmp;
		Ray ray_tmp = ray;
		mat4 r = rotate_y(-cube_light_pos[i].w);
		ray_tmp.origin -= cube_light_pos[i].xyz;
		ray_tmp.dir = vec3(r * vec4(ray_tmp.dir, 0));
		ray_tmp.origin = vec3(r * vec4(ray_tmp.origin, 1.0));
		float t = intersect_box(ray_tmp, normal_tmp,
				vec3(-cube_light_size * 0.5),
				vec3(cube_light_size * 0.5));
		if(t < t_min) {
			t_min = t;
			p = ray_at(ray, t);
			material = MAT_LIGHT0 + i;
			normal = vec3(transpose(r) * vec4(normal_tmp, 0.0));
            obj_index = i;
		}
	}
	// left
	{
		vec3 n = vec3(1, 0, 0);
		float t = intersect_plane(ray, vec3(-1, 0, 0), n);
		if(t < t_min) {
			vec3 p_tmp = ray_at(ray, t);
			if(all(lessThanEqual(p_tmp.yz, vec2(1))) && all(greaterThanEqual(p_tmp.yz,
							vec2(-1))))
			{
				normal = n;
				p = p_tmp;

				t_min = t;

				material = MAT_LEFT;
			}
		}
	}
	// right
	{
		vec3 n = vec3(-1, 0, 0);
		float t = intersect_plane(ray, vec3(1, 0, 0), n);
		if(t < t_min) {
			vec3 p_tmp = ray_at(ray, t);
			if(all(lessThanEqual(p_tmp.yz, vec2(1))) && all(greaterThanEqual(p_tmp.yz,
							vec2(-1))))
			{
				normal = n;
				p = p_tmp;

				t_min = t;

				material = MAT_RIGHT;
			}
		}
	}
	// floor
	{
		vec3 n = vec3(0, 1, 0);
		float t = intersect_plane(ray, vec3(0, -1, 0), n);
		if(t < t_min) {
			vec3 p_tmp = ray_at(ray, t);
			if(all(lessThan(p_tmp.xz, vec2(1))) && all(greaterThan(p_tmp.xz,
							vec2(-1))))
			{
				normal = n;
				p = p_tmp;

				t_min = t;
				material = MAT_FLOOR;
			}
		}
	}
	// ceiling
	{
		vec3 n = vec3(0, -1, 0);
		float t = intersect_plane(ray, vec3(0, 1, 0), n);
		if(t < t_min) {
			vec3 p_tmp = ray_at(ray, t);
			if(all(lessThan(p_tmp.xz, vec2(1))) && all(greaterThan(p_tmp.xz,
							vec2(-1))))
			{
				normal = n;
				p = p_tmp;
				material = MAT_CEILING;

				t_min = t;
			}
		}
	}
	// back wall
	{
		vec3 n = vec3(0, 0, 1);
		float t = intersect_plane(ray, vec3(0, 0, -1), n);
		if(t < t_min) {
			vec3 p_tmp = ray_at(ray, t);
			if(all(lessThan(p_tmp.xy, vec2(1))) && all(greaterThan(p_tmp.xy,
							vec2(-1))))
			{
				normal = n;
				p = p_tmp;
				material = MAT_BACK;

				t_min = t;
			}
		}
	}
    switch(material) {
        case MAT_LEFT   : ms = MaterialSample(vec3(0.9, 0.1, 0.1), 0.25 ,  false); break;
        case MAT_RIGHT  : ms = MaterialSample(vec3(0.1, 0.9, 0.1), 0.25 ,  false); break;
        case MAT_CEILING: ms = MaterialSample(vec3(0.7, 0.7, 0.7), 0.0625, false); break;
        case MAT_FLOOR  : ms = MaterialSample(vec3(0.7, 0.7, 0.7), 0.0144, false); break;
        case MAT_BACK   : ms = MaterialSample(vec3(0.7, 0.7, 0.7), 0.0625, false); break;
        case MAT_H      : ms = MaterialSample(vec3(1.0, 0.0, 0.0), 0.01 , false); break;
        case MAT_P      : ms = MaterialSample(vec3(0.0, 0.7, 0.7), 0.01 , false); break;
        case MAT_G      : ms = MaterialSample(vec3(0.1, 0.1, 0.7), 0.01 , false); break;
        case MAT_2      : ms = MaterialSample(vec3(0.8, 0.8, 0.8), 0.3025, false); break;
        default         : ms = MaterialSample(light_color[material - MAT_LIGHT0], 0.0, true); break;
	}

	normal = normalize(normal);

	return t_min;
}

bool
test_visibility(vec3 ori, vec3 dir, int obj_index)
{
	const float eps = 1e-5;

	Ray r = Ray(ori, dir);
	r.origin += eps * r.dir;

	vec3 n, p;
	MaterialSample ms;
    int obj_idx;
	float t_shadow = intersect(r, p, n, ms,obj_idx);

	return obj_idx == obj_index;
}

float lightDist( vec3 p, vec4 c )
{
    p -= c.xyz;
    p.xz *= ROT(c.w);
    vec3 q = abs(p) - cube_light_size*0.5;
    // Distance to a cube
    return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0);
}


vec3
pt_mis(in Ray ray, out float first_t, out vec3 first_hit)
{
    vec3 contrib = vec3(0);
	vec3 tp = vec3(1.0);
    first_t = INFINITY;

	vec3 position, normal;
	MaterialSample ms;
    int obj_idx;

	float t = intersect(ray, position, normal, ms, obj_idx);
    if(t == INFINITY)
		return vec3(0.,0.,0.);

    first_t = t;
    first_hit = position;

	if(ms.is_light) { // hit light source
        return ms.color;
	}


	for(int b = 0; b < NUM_BOUNCES; b++) {
		float NdotV = max(1e-4, dot(normal, -ray.dir));

        // get uv for LTC LUT
        vec2 uv = vec2(sqrt(sqrt(ms.roughness_sqr)), acos(NdotV)/(0.5*3.141593)) * (LUT_SIZE-1.);        
        uv += vec2(0.5, 0.5);
        // matrix coefficient for the isotropic brdf 
        vec4 coefs = texture(iChannel0, (uv+vec2(LUT_SIZE, 0.0))/iChannelResolution[0].xy);
        // scale of the cosine brdf
        float spec_magnitude = texture(iChannel0, uv/iChannelResolution[0].xy).x;

        // transformation matrices
        mat3 world_to_shading_ = transpose(orthonormal_basis(normal,-ray.dir));
        mat4x3 world_to_shading = mat4x3(world_to_shading_[0],
                                         world_to_shading_[1],
                                         world_to_shading_[2],
                                         -world_to_shading_*position);
        mat3x3 shading_to_cosine = mat3x3(
            vec3(1.,        0,      coefs.y),
            vec3(  0,     coefs.z,   0),
            vec3(coefs.w,   0,      coefs.x)            
        );
        mat4x3 world_to_cosine = shading_to_cosine*world_to_shading;
        mat3x3 cosine_to_shading = inverse(shading_to_cosine);
        float det_shading_to_cosine = determinant(shading_to_cosine);

        // Sample LIGHT
		{ // NEE 

            // Selects a light based on its intensity and distance from the intersection point 
            int light_index = 0;
            // light distance from the intersection point
            vec4 d = vec4(lightDist(position,cube_light_pos[0]), 
                          lightDist(position,cube_light_pos[1]),
                          lightDist(position,cube_light_pos[2]),
                          lightDist(position,cube_light_pos[3]));
            // light intensity
            vec4 lc = vec4(light_color[0].x+light_color[0].y+light_color[0].z,
                           light_color[1].x+light_color[1].y+light_color[1].z,
                           light_color[2].x+light_color[2].y+light_color[2].z,
                           light_color[3].x+light_color[3].y+light_color[3].z);
            // pdf
            lights_pdf = lc / (d*d);
            // normalize pdf
            lights_pdf /= lights_pdf.x + lights_pdf.y + lights_pdf.z + lights_pdf.w;
            // sample a light
            float rng = get_random().x;
            if(rng <= lights_pdf[0]){
                light_index = 0;
            } else if(rng - lights_pdf[0] <= lights_pdf[1]) {
                light_index = 1;
            } else if(rng - lights_pdf[0] - lights_pdf[1] <= lights_pdf[2]) {
                light_index = 2;
            } else {
                light_index = 3;
            }


            // computes the silhouette of the cube light 
            vec3 silhouette[MAX_POLYGON_VERTEX_COUNT];
            findSilhouette(position,light_index, world_to_cosine, silhouette, vertex_num);
            // clip the silhouette
            vertex_num = clip_polygon(vertex_num, silhouette);
            // samples the light only if it is visible
            if(vertex_num!=0u) {

                poly = prepare_projected_solid_angle_polygon_sampling(vertex_num,silhouette);

                // samples a light direction
                vec3 L_cs = sample_projected_solid_angle_polygon(poly, get_random());
                vec3 L_ss = normalize(cosine_to_shading * L_cs);
                vec3 L    = (transpose(world_to_shading) * L_ss).xyz;

                if(L_ss.z > 0. && L_cs.z > 0. && test_visibility(position, L, light_index)) {

                    float ltc_density = evaluate_ltc_density(shading_to_cosine, det_shading_to_cosine, L_ss);
                    ltc_density *= spec_magnitude;

                    vec3 H = normalize(L - ray.dir);
                    float  NdotL = max(1e-6, L_ss.z);
                    float  NdotH = max(1e-6, dot(normal, H));
                    float  LdotH = max(1e-6, dot(L, H));

                    // Evaluate our BRDF using a microfacet BRDF model
                    float D = ggxNormalDistribution(NdotH, ms.roughness_sqr);          
                    float G = schlickMaskingTerm(NdotL, NdotV, ms.roughness_sqr); 
                    vec3  F = schlickFresnel(ms.color, LdotH);                 
                    vec3  brdf = D * G * F / (4.0 * NdotL * NdotV);  

                    float light_pdf = ltc_density * lights_pdf[light_index] / poly.projected_solid_angle;

                    contrib += tp * light_color[light_index] * brdf / light_pdf;
                } 
            }
		}
        // Sample BRDF
		{ // brdf 


            // Randomly sample the NDF to get a microfacet in our BRDF 
			vec3 H = normalize( getGGXMicrofacetTS(get_random(), ms.roughness_sqr, normal).xzy * mat3(world_to_shading));

			// Compute outgoing direction based on this (perfectly reflective) facet
			vec3 L = normalize(reflect(ray.dir, H));

			// Compute some dot products needed for shading
			float  NdotL = dot(normal, L); 
            if(NdotL < 0.)
                break;
            NdotL = max(1e-6, NdotL);
			float  NdotH = max(1e-6, dot(normal, H));
			float  LdotH = max(1e-6, dot(L, H));

			// Evaluate our BRDF using a microfacet BRDF model
			float G = schlickMaskingTerm(NdotL, NdotV, ms.roughness_sqr); 
			vec3  F = schlickFresnel(ms.color, LdotH);                 
			/*
			float D = ggxNormalDistribution(NdotH, ms.roughness_sqr);          
            vec3  brdf = D * G * F / (4.0 * NdotL * NdotV);     
            float brdf_pdf = D * NdotH / (4.0 * LdotH);
            */

			ray = Ray(position + L * 1e-5, L);

            vec3 position_next, normal_next;
			MaterialSample ms_next;
            int obj_idx;
			float t = intersect(ray, position_next, normal_next, ms_next, obj_idx);

			if(t == INFINITY || ms_next.is_light){
				break;
            }

            //tp *= NdotL * brdf / brdf_pdf;
            tp *= G * F * LdotH / (NdotV * NdotH);

			position = position_next;
			normal = normal_next;
			ms = ms_next;
		}
	}
    #ifdef CLAMP_CONTRIB
	return clamp(contrib,vec3(0.),vec3(2.));
    #else
    return contrib;
    #endif
}


mat3 setCamera( in vec3 ro, in vec3 ta)
{
	vec3 rd = normalize(ta-ro);
	vec3 ri = normalize( cross(rd,vec3(0.,1.,0.)) );
	vec3 up = normalize( cross(ri,rd) );
    return mat3( ri, up, rd );
}



void
mainImage(out vec4 fragColor, in vec2 fragCoord)
{

	seed = iFrame * NUM_SAMPLES;
	flat_idx = int(dot(gl_FragCoord.xy, vec2(1,4096)));

    vec2 uv = fragCoord.xy / iResolution.xy;
    vec2 ji  = get_random()-0.5;
	vec2 p = ((fragCoord+ji)-iResolution.xy*0.5)/iResolution.xy;

    float a = iResolution.x/iResolution.y;
    vec2 a_;
	if(a < 1.0){
        a_ = vec2(1.,a);
		p.y /= a;
    }
	else{
        a_ = vec2(1./a,1.0);
		p.x *= a;
    }

    #ifdef STOP_CAMERA
    float time = 0.;
    float delta_time = 0.;
    #else
    float time = iTime;
    float delta_time = iTimeDelta;
    #endif

    vec3  ro = vec3(sin(time) * 0.25, sin(time * 0.7345) * 0.4 + 0.2, 6.0);
    vec3  ta = vec3( 0.0, -0.1, 0.0 );
    mat3 cam = setCamera(ro,ta);


	vec3 s = vec3(0);
    float first_t;
    vec3 first_hit;
    Ray ray;
    vec2 r;
	for(int i = 0; i < NUM_SAMPLES; i++) {
        ray.dir = normalize( cam*vec3(p.xy,2.5) );
        ray.origin = ro;		
        vec3 c = pt_mis(ray,first_t, first_hit);
		s += c;
	}
    s /= float(NUM_SAMPLES);


    #ifdef WS_REPROJ

    // Reprojection based on iq "Some boxes"
    // https://www.shadertoy.com/view/Xd2fzR

    // Get previous camera
    vec3 prev_ro = vec3(sin(time-delta_time) * 0.25, sin( (time-delta_time) * 0.7345) * 0.4 + 0.2, 6.0);
	vec3 prev_ta = vec3(0, -0.1, 0);
    mat3 prev_cam = setCamera(prev_ro,prev_ta);

    // Get previous uv
    vec3 hit_prev_cam_space = (first_hit-prev_ro)*prev_cam;
    vec2 prev_uv = 0.5 + 2.5*(hit_prev_cam_space.xy/hit_prev_cam_space.z)*a_;//vec2(iResolution.y/iResolution.x,1.0);
    prev_uv -= ji/iResolution.xy;

    // Get previous color
    vec4 prev_col = textureLod( iChannel1, prev_uv, 0.0 );

    // Mix previous and current color
    if( iFrame>0 && first_t<INFINITY  )
    {
        s = mix( prev_col.xyz, s, WS_REPROJ_FACTOR );
    }

    // Set the mixed color and the previous uv (for the screen space TAA)
    fragColor = vec4(s,uintBitsToFloat(packSnorm2x16(prev_uv)));
    #else 
    fragColor = vec4(s,uintBitsToFloat(packSnorm2x16(uv)));
    #endif
}

// Tonemapping and gamma correction
void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	fragColor = textureLod(iChannel0,fragCoord.xy / iResolution.xy,0.);
    fragColor.xyz = vec3(pow(EXPOSURE * fragColor.xyz, vec3(GAMMA)));
}

// Screen space temporal antialiasing 
void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	vec2 uv = fragCoord.xy / iResolution.xy;

    #ifdef SS_TAA

    vec2 off = 1.0 / iResolution.xy;

    // current color
    vec3 cur_color0 = textureLod(iChannel0, uv,0.).xyz;

    // if it is the first frame their is nothing to accumulate
    if(iFrame == 0){
        fragColor = vec4(cur_color0,0.5);
        return;
    }


    // uv of previous intersection point
    vec2 prev_uv = unpackSnorm2x16(floatBitsToUint(textureLod(iChannel0, uv,0.).w));

    // previous data
    vec4  prev_data = textureLod(iChannel1, prev_uv,0.);
    float prev_mix_factor = prev_data.w;
    vec3  prev_color = prev_data.xyz;


    vec3 new_color = mix(prev_color, cur_color0, prev_mix_factor);

    // current color of neighbours pixels
    vec3 cur_color1 = textureLod(iChannel0, uv + vec2(+off.x, 0.0)   ,0.).xyz;
    vec3 cur_color2 = textureLod(iChannel0, uv + vec2(-off.x, 0.0)   ,0.).xyz;
    vec3 cur_color3 = textureLod(iChannel0, uv + vec2(0.0, +off.y)   ,0.).xyz;
    vec3 cur_color4 = textureLod(iChannel0, uv + vec2(0.0, -off.y)   ,0.).xyz;
    vec3 cur_color5 = textureLod(iChannel0, uv + vec2(+off.x, +off.y),0.).xyz;
    vec3 cur_color6 = textureLod(iChannel0, uv + vec2(-off.x, +off.y),0.).xyz;
    vec3 cur_color7 = textureLod(iChannel0, uv + vec2(+off.x, -off.y),0.).xyz;
    vec3 cur_color8 = textureLod(iChannel0, uv + vec2(-off.x, -off.y),0.).xyz;


    // adjacent pixels
    vec3 min_col_4 = min(min(min(cur_color1, cur_color2),min(cur_color3, cur_color4)),cur_color0);
    vec3 max_col_4 = max(max(max(cur_color1, cur_color2),max(cur_color3, cur_color4)),cur_color0);

    // corner
    vec3 min_col_8 = min(min(min(cur_color5, cur_color6),min(cur_color7, cur_color8)),cur_color0);
    vec3 max_col_8 = max(max(max(cur_color5, cur_color6),max(cur_color7, cur_color8)),cur_color0);

    // mix neightbours min and max colors based on their distance to the current pixel
    const float mix_factor = sqrt(2.)/(1.+sqrt(2.));


    vec3 new_color_clamp = clamp(new_color,
                      mix(min_col_4,min_col_8,mix_factor),
                      mix(max_col_4,max_col_8,mix_factor));


    // Update mix factor based on yvtjp shader :
    // https://www.shadertoy.com/view/4tcXD2

    float new_mix_factor = prev_mix_factor / (prev_mix_factor + 1.0);
    vec3 diff = new_color - new_color_clamp;
    float clampAmount = dot(diff, diff);
    new_mix_factor += clampAmount * 4.0;
    new_mix_factor = clamp(new_mix_factor, 0.01, 0.5);


    fragColor = vec4(new_color_clamp, new_mix_factor);
    #else
    fragColor = textureLod(iChannel0,uv,0.);
    #endif
}
